function ArtStudio() {

    const classes = useStyles();

    return (
        <Paper>
            <Grid container>
                <Grid xs={4}>
                    <img className={classes.thumbnail} src="http://svcdn.simpleviewinc.com/v3/cache/www_exploreboone_com/6C64B54F6BBBC5E96E9BFBF461DA56D3.jpg" />
                </Grid>
                <Grid xs={8}>
                    <Typography variant="h5">
